// üìÅ BRAMHAND/frontend/src/pages/Vishnu.jsx
import React from 'react';
import { useNavigate, useLocation } from 'react-router-dom';

export default function Vishnu() {
  const navigate = useNavigate();
  const location = useLocation();
  const dataFromBackend = location.state?.dataFromBackend;

  if (!dataFromBackend) {
    return (
      <div className="min-h-screen flex items-center justify-center text-white bg-gradient-to-b from-[#0f0c29] via-[#302b63] to-[#0f0c29]">
        <h1 className="text-3xl">üö´ No data found. Please start from Brahma page.</h1>
      </div>
    );
  }

  const { preview_data, metrics, task_type, columns } = dataFromBackend;

  return (
    <div className="min-h-screen bg-gradient-to-b from-[#0f0c29] via-[#302b63] to-[#0f0c29] flex flex-col items-center justify-start p-6 text-white">
      <h1 className="text-5xl font-bold mb-8 animate-pulse mt-8">üî± Vishnu's Chamber of Purification</h1>

      {/* Purified Data Preview */}
      <div className="w-full max-w-5xl mb-8">
        <h2 className="text-2xl font-semibold mb-4">üìú Purified Karma Data (Top 5 Rows):</h2>
        <div className="overflow-x-auto">
          <table className="min-w-full table-auto text-sm text-gray-300">
            <thead>
              <tr>
                {columns.map((col, index) => (
                  <th key={index} className="border px-4 py-2">{col}</th>
                ))}
              </tr>
            </thead>
            <tbody>
              {preview_data.map((row, rowIndex) => (
                <tr key={rowIndex}>
                  {columns.map((col, colIndex) => (
                    <td key={colIndex} className="border px-4 py-2">
                      {row[col] !== undefined ? row[col] : '-'}
                    </td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>

      {/* Model and Metrics */}
      <div className="w-full max-w-4xl bg-[#1a1a2e] rounded-lg p-6 shadow-lg mb-8">
        <h2 className="text-2xl font-semibold mb-4">üìä Cosmic Evaluation Metrics:</h2>
        <p className="text-lg mb-4">üîÆ Detected Task Type: <strong className="text-yellow-400">{task_type.toUpperCase()}</strong></p>
        <div className="space-y-2">
          {metrics &&
            Object.entries(metrics).map(([key, value]) => (
              <div key={key} className="flex justify-between border-b py-2">
                <span className="capitalize">{key.replace('_', ' ')}:</span>
                <span className="font-semibold">{typeof value === 'number' ? value.toFixed(3) : value}</span>
              </div>
            ))
          }
        </div>
      </div>

      {/* Proceed to Shiva */}
      <button
        onClick={() => navigate('/shiva', { state: { dataFromBackend } })}
        className="mt-6 bg-yellow-400 hover:bg-yellow-500 text-black font-bold py-3 px-8 rounded-full transition transform hover:scale-105"
      >
        üõï Proceed to Shiva
      </button>
    </div>
  );
}
